import React, { Component } from "react";
import { Link } from "react-router-dom";

export default class Landing extends Component{
    render(){
        return(    
            <div className="container text-center" style={{marginTop:"70px"}}> 
            <h1>Welcome</h1>
            <p className="lead text-muted">Welcome to my app.</p>
            <p>
                <Link 
                    to="/register" 
                    style={{
                        width: "140px",
                        letterSpacing: "1.5px",
                        borderRadius:"5px",
                        margin: "5px"
                        }}
                    className="btn btn-primary my-2">Register</Link>


                <Link 
                    to="/login" 
                    style={{
                        width: "140px",
                        letterSpacing: "1.5px",
                        borderRadius:"5px",
                        margin: "5px"
                        }}
                    className="btn btn-secondary my-2">Login</Link>
            </p>
            </div>
           
        )
    }
}
